webpackJsonp([0xe1552d0dacb0],{8271:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Cheap Sunglasses",date:"14 Jul 2006",slug:"/2006-07-14-cheap-sunglasses/",tags:"Y2006"},html:'<p><a href="http://www.flickr.com/photos/papascott/189539718/" title="Photo Sharing"><img src="http://static.flickr.com/69/189539718_34f33762fa_m.jpg" width="240" height="180" alt="14072006037" /></a></p>\n<p>Sonnenbrille Fielmann.</p>'},next:{fields:{title:"Yo Momma!",date:"11 Jul 2006",slug:"/2006-07-11-yo-momma/"}},previous:{fields:{title:"Half a Man",date:"14 Jul 2006",slug:"/2006-07-14-half-a-man/"}}},{node:{fields:{title:"Yo Momma!",date:"11 Jul 2006",slug:"/2006-07-11-yo-momma/",tags:"Y2006"},html:'<p>Anil Dash: <a href="http://www.dashes.com/anil/2006/07/11/zidane_world_cu">Zidane World Cup Headbutt Animation Festival</a></p>'},next:{fields:{title:"World Cup Ratings",date:"11 Jul 2006",slug:"/2006-07-11-world-cup-ratings/"}},previous:{fields:{title:"Cheap Sunglasses",date:"14 Jul 2006",slug:"/2006-07-14-cheap-sunglasses/"}}},{node:{fields:{title:"World Cup Ratings",date:"11 Jul 2006",slug:"/2006-07-11-world-cup-ratings/",tags:"Y2006"},html:'<p>About <a href="http://www.nytimes.com/2006/07/11/sports/soccer/11sandomir.html?ex=1310270400&amp;en=1ad955d799db8bdd&amp;ei=5090&amp;partner=rssuserland&amp;emc=rss">16.9 million viewers</a> watched the World Cup final in the US, 2/3 in English on ABC, 1/3 in Spanish on Univision. That\'s roughly the same number who watch the NCAA men\'s basketball final or the World Series. That\'s also <a href="http://worldcup.blogs.nytimes.com/?p=343">roughly the same number</a> of viewers who watched the final in Great Britain.</p>\n<p>And for all those folks <a href="http://worldcup.blogs.nytimes.com/?p=274">complaining about the American announcers</a>, you don\'t know how good you have it. I had to watch 90% of the games in 1986 and 1990 in Spanish. I\'m sure I heard the name <a href="http://en.wikipedia.org/wiki/Diego_Maradona">"Diego"</a> uttered at least ten thousand times. And you don\'t have to listen to <a href="http://www.stopptbeckmann.de/">Reinhold Beckmann</a> either.</p>'},next:{fields:{title:"Fanfest",date:"10 Jul 2006",slug:"/2006-07-10-fanfest/"}},previous:{fields:{title:"Yo Momma!",date:"11 Jul 2006",slug:"/2006-07-11-yo-momma/"}}}],pathPrefix:"",first:!1,last:!1,index:208,pageCount:1101}}}});
